import React from 'react';
import { Link } from 'react-router-dom';
import { Navigation } from '@mui/icons-material'; 

const Navbar = () => {
  return (
    <><navigation></navigation>
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/Userhome" className="navbar-logo">
          XYZ Hospital
        </Link>
        <div className="nav-menu">
          <Link to="/Userhome" className="nav-link">
            Home
          </Link>
          <Link to="/Userbook" className="nav-link">
            User Book
          </Link>
        </div>
      </div>
    </nav>
    </>
  );
};

const Userhome = () => {
  return (
    <div className="home-container">
      <Navbar />
      <div className="home-content">
        <h1>Welcome to XYZ Hospital</h1>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut rhoncus
          risus eget dapibus facilisis.
        </p>
        <p>
          In this hospital, we strive to provide the best healthcare services
          to our patients.
        </p>
        <Link to="/Userbook">
          <button className="get-started-btn">Get Started</button>
        </Link>
      </div>
    </div>
  );
};

export default Userhome;
